import react from 'react';
import Button  from '../../container/button';
import './styles.scss';

interface allDivPlayer {
    beeingPlaying: boolean
}

const AllDivPlayer = ({ beeingPlaying}: allDivPlayer) => (
    <div className='allDivButton'>
    {!beeingPlaying && <Button buttonName={'begin'} buttonClass={'allDivPlayer'} />}
    {beeingPlaying && <Button buttonName={'attack'} buttonClass={'allDivPlayer'} />}
    {beeingPlaying && <Button buttonName={'magicFire'} buttonClass={'allDivPlayer'} />}
    {beeingPlaying && <Button buttonName={'heal'} buttonClass={'allDivPlayer'} />}
    {beeingPlaying && <Button buttonName={'giveUp'} buttonClass={'allDivPlayer'} />}
    </div>
)
export default AllDivPlayer
